import '../dash.css';
const Table=(props)=>{
    const {postData}=props
    const rows=postData.map((post)=>{
      return(
      <tr>
          <td>{post.username}</td>
          <td>{post.post_name}</td>
      </tr>
      )
  
  })
    return
    <table>
        <tr>
         <th>Username</th>
        <th>Task Name</th>
        </tr>
        <tbody>
                    {rows}    
        </tbody>
     </table>
}
export default Table;
